import React from 'react'
import styled from 'styled-components'
import { Swiper, SwiperSlide } from 'swiper/react';
import { Pagination, Autoplay } from 'swiper'
import 'swiper/css';

import 'swiper/css/pagination';
const Visual = () => {
    return (
        <div>
            <StMainVideo>
                <video autoPlay muted >
                    <source type='video/mp4' src="https://contents-image.twayair.com/contents/2022/0318/44a544c5-d7a8-45c0-b5ad-bbfa574fa09c.mp4" />
                </video>
            </StMainVideo>
            <StSwiper>
                <Swiper
                    modules={[Pagination, Autoplay]}
                    pagination={{ clickable: true }}

                    autoplay
                    spaceBetween={50}

                    slidesPerView={1}
                    onSlideChange={() => console.log('slide change')}
                    onSwiper={(swiper) => console.log(swiper)}
                >
                    <SwiperSlide><img src="https://contents-image.twayair.com/contents/2022/0906/edf73d5a-8c4f-40e8-9bc1-29d3480fc241.png" alt="" /></SwiperSlide>
                    <SwiperSlide>Slide 2</SwiperSlide>
                    <SwiperSlide>Slide 3</SwiperSlide>
                    <SwiperSlide>Slide 4</SwiperSlide>

                </Swiper>
            </StSwiper>
        </div>

    )
}

export default Visual

const StMainVideo = styled.div`

    width: 100%;
    position: absolute;
    top: 0;
    left: 0;
    z-index: -1;
`
const StSwiper = styled.div`
    width: 1200px;
    margin:  0 auto;
`
